import java.util.logging.*;

public class BookDAO {
    public Book findByISBN(String isbn) {
        Book book = null;

        Connection connection = null;
        Statement statement = null;
        ResultSet resultSet = null;

        try {
            connection = Database.getConnection();
            statement = connection.createStatement();

            String query = "SELECT * FROM book, publisher, title "
                    + "WHERE book.isbn13 = '"
                    + isbn + "' "
                    + "AND book.title_id = title.id "
                    + "AND book.publisher_id = publisher.id;";
            resultSet = statement.executeQuery(query);
            Logger.getLogger(this.getClass().getName()).log(Level.FINE, "findByISBN SQL Query: " + query);

            if (resultSet.next()) {
                AuthorDAO authorDAO = new AuthorDAO(); // TODO:

                book = new Book();
                book.setId(resultSet.getInt("book.id"));
                book.setTitle(new Title(resultSet.getInt("title.id"), resultSet.getString("title.name")));
                book.setPublisher(new Publisher(resultSet.getInt("publisher.id"), resultSet.getString("publisher.name")));
                book.setPublished(resultSet.getString("book.published"));
                book.setEdition(resultSet.getInt("book.edition"));
                book.setBinding(resultSet.getString("book.binding"));
                book.setIsbn10(resultSet.getString("book.isbn10"));
                book.setIsbn13(resultSet.getString("book.isbn13"));
                book.setDescription(resultSet.getString("book.description"));
                book.setAuthor(authorDAO.findByBookID(resultSet.getInt("book.id")));
                book.setPrice(resultSet.getFloat("book.price"));
                // TODO: Reviews, Categories
            }
        } catch (SQLException exception) {
            Logger.getLogger(this.getClass().getName()).log(Level.SEVERE, null, exception);
        } finally {
            Database.close(connection, statement, resultSet);
        }

        return book;
    }
}

package amu.database;

import amu.model.Author;

import java.sql.*;
import java.util.ArrayList;
import java.util.List;
import java.util.logging.Level;
import java.util.logging.Logger;

public class AuthorDAO {
    public List<Author> findByBookID(int bookID) {
        List<Author> authors = new ArrayList<Author>();

        Connection connection = null;
        Statement statement = null;
        ResultSet resultSet = null;

        try {
            connection = Database.getConnection();
            statement = connection.createStatement();

            String query = "SELECT "
                    + "author.id, "
                    + "author.name "
                    + "FROM author, author_x_book "
                    + "WHERE author_x_book.book_id=" + bookID + " "
                    + "AND author.id = author_x_book.author_id";
            resultSet = statement.executeQuery(query);
            Logger.getLogger(this.getClass().getName()).log(Level.FINE, "findByBookID SQL Query: " + query);

            while (resultSet.next()) {
                authors.add(new Author(resultSet.getInt("author.id"), resultSet.getString("author.name")));
            }
        } catch (SQLException exception) {
            Logger.getLogger(this.getClass().getName()).log(Level.SEVERE, null, exception);
        } finally {
            Database.close(connection, statement, resultSet);
        }

        return authors;
    }
}

package amu.database;

import amu.model.Address;
import amu.model.Customer;
import java.sql.Connection;
import java.sql.PreparedStatement;
import java.sql.ResultSet;
import java.sql.SQLException;
import java.util.ArrayList;
import java.util.List;
import java.util.logging.Level;
import java.util.logging.Logger;

public class AddressDAO {

    Connection connection = null;
    PreparedStatement statement = null;
    ResultSet resultSet = null;

    public List<Address> browse(Customer customer) {
        List<Address> addresses = new ArrayList<Address>();

        try {
            connection = Database.getConnection();
            String query = "SELECT id, address FROM address WHERE customer_id=?";
            statement = connection.prepareStatement(query);

            statement.setInt(1, customer.getId());

            resultSet = statement.executeQuery();

            while (resultSet.next()) {
                addresses.add(new Address(resultSet.getInt("id"), customer, resultSet.getString("address")));
            }
        } catch (SQLException exception) {
            Logger.getLogger(this.getClass().getName()).log(Level.SEVERE, null, exception);
        } finally {
            Database.close(connection, statement, resultSet);
        }

        return addresses;
    }

    public Address read(int id) {
        Address address = null;

        try {
            connection = Database.getConnection();

            String query = "SELECT address FROM address WHERE id=?";
            statement = connection.prepareStatement(query);
            statement.setInt(1, id);

            resultSet = statement.executeQuery();

            if (resultSet.next()) {
                address = new Address(id, null, resultSet.getString("address")); 
            } 
        } catch (SQLException exception) {
            Logger.getLogger(this.getClass().getName()).log(Level.SEVERE, null, exception);
        } finally {
            Database.close(connection, statement, resultSet);
        }

        return address;
    }

    public boolean edit(Address address) {

        try {
            connection = Database.getConnection();

            String query = "UPDATE address SET address=? WHERE id=?";
            statement = connection.prepareStatement(query);
            statement.setString(1, address.getAddress());
            statement.setInt(2, address.getId());

            if (statement.executeUpdate() > 0) {
                return true;
            }
        } catch (SQLException exception) {
            Logger.getLogger(this.getClass().getName()).log(Level.SEVERE, null, exception);
        } finally {
            Database.close(connection, statement, resultSet);
        }

        return false;
    }

    public boolean add(Address address) {

        try {
            connection = Database.getConnection();

            String query = "INSERT INTO address (customer_id, address) VALUES (?, ?)";
            statement = connection.prepareStatement(query);
            statement.setInt(1, address.getCustomer().getId());
            statement.setString(2, address.getAddress());

            if (statement.executeUpdate() > 0) {
                return true;
            }
        } catch (SQLException exception) {
            Logger.getLogger(this.getClass().getName()).log(Level.SEVERE, null, exception);
        } finally {
            Database.close(connection, statement, resultSet);
        }

        return false;
    }

    public boolean delete(int id) {

        try {
            connection = Database.getConnection();

            String query = "DELETE FROM address WHERE id=?";
            statement = connection.prepareStatement(query);
            statement.setInt(1, id);

            if (statement.executeUpdate() > 0) {
                return true;
            }
        } catch (SQLException exception) {
            Logger.getLogger(this.getClass().getName()).log(Level.SEVERE, null, exception);
        } finally {
            Database.close(connection, statement, resultSet);
        }

        return false;
    }
}

package amu.action;

import amu.database.AddressDAO;
import amu.database.CreditCardDAO;
import amu.database.OrderDAO;
import amu.model.Address;
import amu.model.CreditCard;
import amu.model.Customer;
import amu.model.Order;
import java.util.List;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class ViewCustomerAction implements Action {

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) throws Exception {

        HttpSession session = request.getSession(true);
        Customer customer = (Customer) session.getAttribute("customer");

        if (customer == null) {
            ActionResponse actionResponse = new ActionResponse(ActionResponseType.REDIRECT, "loginCustomer");
            actionResponse.addParameter("from", "viewCustomer");
            return actionResponse;
        } else {
            CreditCardDAO creditCardDAO = new CreditCardDAO();
            List<CreditCard> creditCards = creditCardDAO.browse(customer);
            request.setAttribute("creditCards", creditCards);

            AddressDAO addressDAO = new AddressDAO();
            List<Address> addresses = addressDAO.browse(customer);
            request.setAttribute("addresses", addresses);

            OrderDAO orderDAO = new OrderDAO();
            List<Order> orders = orderDAO.browse(customer);
            request.setAttribute("orders", orders);

            return new ActionResponse(ActionResponseType.FORWARD, "viewCustomer");
        }
    }
}

