package amu.action;

import amu.Mailer;
import amu.database.CustomerDAO;
import amu.model.Customer;
import javax.servlet.http.HttpServlet;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class RegisterCustomerAction extends HttpServlet implements Action {

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) throws Exception {

        if (request.getMethod().equals("POST")) {
            CustomerDAO customerDAO = new CustomerDAO();
            Customer customer = customerDAO.findByEmail(request.getParameter("email"));

            if (customer == null) {
                customer = new Customer();
                customer.setEmail(request.getParameter("email"));
                customer.setName(request.getParameter("name"));
                customer.setPassword(CustomerDAO.hashPassword(request.getParameter("password")));
                customer.setActivationToken(CustomerDAO.generateActivationCode());
                customer = customerDAO.register(customer);

                ActionResponse actionResponse = new ActionResponse(ActionResponseType.REDIRECT, "activateCustomer");
                actionResponse.addParameter("email", customer.getEmail());

                StringBuilder sb = new StringBuilder();
                sb.append("Welcome to Amu-Darya, the really insecure bookstore!\n\n");
                sb.append("To activate your account, click <a href='http://");
                sb.append(request.getServerName() + ":" + request.getServerPort() + request.getContextPath() + "/");
                sb.append(actionResponse.getURL() + actionResponse.getParameterString());
                sb.append("&activationToken=" + customer.getActivationToken());
                sb.append("'>here</a>, or use this activation code: " + customer.getActivationToken());

                Mailer.send(customer.getEmail(), "Activation required", sb.toString());

                return actionResponse;
            } else {
                return new ActionResponse(ActionResponseType.REDIRECT, "registrationError");
            }
        }

        // Else we show the register form
        return new ActionResponse(ActionResponseType.FORWARD, "registerCustomer");
    }
}

package amu.action;

import amu.database.OrderDAO;
import amu.model.Cart;
import amu.model.Customer;
import amu.model.Order;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class PlaceOrderAction implements Action {

    public PlaceOrderAction() {
    }

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) {
        HttpSession session = request.getSession();

        Cart cart = (Cart) session.getAttribute("cart");
        if (cart == null) {
            cart = new Cart();
            session.setAttribute("cart", cart);
            return new ActionResponse(ActionResponseType.REDIRECT, "viewCart");
        }

        Customer customer = (Customer) session.getAttribute("customer");
        if (customer == null) {
            ActionResponse actionResponse = new ActionResponse(ActionResponseType.REDIRECT, "loginCustomer");
            actionResponse.addParameter("from", "placeOrder");
            return actionResponse;
        }

        OrderDAO orderDAO = new OrderDAO();
        Order order = new Order(customer, cart.getShippingAddress(), cart.getSubtotal().toString());

        if (orderDAO.add(order))
        {
            cart = new Cart();
            session.setAttribute("cart", cart);
            return new ActionResponse(ActionResponseType.REDIRECT, "placeOrderSuccessful");
        } else {
            return new ActionResponse(ActionResponseType.REDIRECT, "placeOrderError");
        }
    }
}

package amu.action;

import amu.database.CustomerDAO;
import amu.model.Customer;
import java.util.HashMap;
import java.util.Map;

import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class LoginCustomerAction implements Action {

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) throws Exception {

        Map<String, String> values = new HashMap<String, String>();
        request.setAttribute("values", values);
        if (ActionFactory.hasKey(request.getParameter("from"))) {
            values.put("from", request.getParameter("from"));
        }

        if (request.getMethod().equals("POST")) {

            Map<String, String> messages = new HashMap<String, String>();
            request.setAttribute("messages", messages);

            CustomerDAO customerDAO = new CustomerDAO();
            Customer customer = customerDAO.findByEmail(request.getParameter("email"));

            if (customer != null) {
                values.put("email", request.getParameter("email"));

                if (customer.getActivationToken() == null) {
                    if (customer.getPassword().equals(CustomerDAO.hashPassword(request.getParameter("password")))) {
                        HttpSession session = request.getSession(true);
                        session.setAttribute("customer", customer);
                        if (ActionFactory.hasKey(request.getParameter("from"))) {
                            return new ActionResponse(ActionResponseType.REDIRECT, request.getParameter("from"));
                        }
                    } else { // Wrong password
                        messages.put("password", "Password was incorrect.");
                    }
                } else { // customer.getActivationToken() != null
                    return new ActionResponse(ActionResponseType.REDIRECT, "activateCustomer");
                }
            } else { // findByEmail returned null -> no customer with that email exists
                messages.put("email", "Email was incorrect.");
            }

            // Forward to login form with error messages
            return new ActionResponse(ActionResponseType.FORWARD, "loginCustomer");
        }

        return new ActionResponse(ActionResponseType.FORWARD, "loginCustomer");
    }
}

