package amu.action;

import amu.database.BookDAO;
import amu.model.Book;
import amu.model.Cart;
import amu.model.CartItem;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class AddToCartAction implements Action {

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) throws Exception {
        HttpSession session = request.getSession();

        Cart cart = (Cart) session.getAttribute("cart");

        if (cart == null)
        {
            cart = new Cart();
            session.setAttribute("cart", cart);
        }

        if (request.getParameter("isbn") != null && request.getParameter("quantity") != null)
        {
            BookDAO bookDAO = new BookDAO();
            Book book = bookDAO.findByISBN(request.getParameter("isbn"));

            cart.addItem(new CartItem(book, Integer.parseInt(request.getParameter("quantity"))));
        }

        return new ActionResponse(ActionResponseType.REDIRECT, "viewCart");
    }

}

package amu.action;

import amu.database.CreditCardDAO;
import amu.model.CreditCard;
import amu.model.Customer;
import java.util.ArrayList;
import java.util.Calendar;
import java.util.GregorianCalendar;
import java.util.HashMap;
import java.util.List;
import java.util.Map;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class AddCreditCardAction implements Action {

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) {
        HttpSession session = request.getSession(true);
        Customer customer = (Customer) session.getAttribute("customer");

        if (customer == null) {
            ActionResponse actionResponse = new ActionResponse(ActionResponseType.REDIRECT, "loginCustomer");
            actionResponse.addParameter("from", "addCreditCard");
            return actionResponse;
        }

        if (request.getMethod().equals("POST")) {
            Map<String, String> messages = new HashMap<String, String>();
            request.setAttribute("messages", messages);

            Calendar expiryDate = Calendar.getInstance();
            expiryDate.set(Integer.parseInt(request.getParameter("expiryYear")), Integer.parseInt(request.getParameter("expiryMonth")), 1);

            CreditCardDAO creditCardDAO = new CreditCardDAO();
            CreditCard creditCard = new CreditCard(
                    customer, 
                    request.getParameter("creditCardNumber"), 
                    expiryDate,
                    request.getParameter("cardholderName"));

            Map<String, String> values = new HashMap<String, String>();
            request.setAttribute("values", values);
            values.put("creditCardNumber", request.getParameter("creditCardNumber"));
            values.put("expiryDate", request.getParameter("expiry"));
            values.put("cardholderName", request.getParameter("cardholderName"));

            if (creditCardDAO.add(creditCard)) {
                return new ActionResponse(ActionResponseType.REDIRECT, "viewCustomer");
            }

            messages.put("error", "An error occured.");
        }

        // (request.getMethod().equals("GET"))
        Calendar calendar = new GregorianCalendar();

        List<String> years = new ArrayList<String>();
        request.setAttribute("years", years);
        for (Integer offset = 0; offset < 10; offset++) {
            years.add(Integer.valueOf(calendar.get(Calendar.YEAR) + offset).toString());
        }

        Map<String, String> months = new HashMap<String, String>();
        request.setAttribute("months", months);
        for (Integer month = 0; month < 12; month++) {
            months.put(month.toString(), Integer.valueOf(month - 1).toString());
        }

        return new ActionResponse(ActionResponseType.FORWARD, "addCreditCard");
    }
}

package amu.action;

import amu.database.AddressDAO;
import amu.model.Address;
import amu.model.Customer;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class AddAddressAction implements Action {

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) {
        HttpSession session = request.getSession(true);
        Customer customer = (Customer) session.getAttribute("customer");

        // Handle referrals
        Map<String, String> values = new HashMap<String, String>();
        request.setAttribute("values", values);
        if (ActionFactory.hasKey(request.getParameter("from"))) {
            values.put("from", request.getParameter("from"));
        }

        if (customer == null) {
            ActionResponse actionResponse = new ActionResponse(ActionResponseType.REDIRECT, "loginCustomer");
            actionResponse.addParameter("from", "addAddress");
            return actionResponse;
        }

        // Non-idempotent add address request
        if (request.getMethod().equals("POST")) {
            List<String> messages = new ArrayList<String>();
            request.setAttribute("messages", messages);

            AddressDAO addressDAO = new AddressDAO();
            Address address = new Address(customer, request.getParameter("address"));

            if (addressDAO.add(address)) {
                if (ActionFactory.hasKey(request.getParameter("from"))) {
                    return new ActionResponse(ActionResponseType.REDIRECT, request.getParameter("from"));
                } else {
                    // Return to viewCustomer from addAddress by default
                    return new ActionResponse(ActionResponseType.REDIRECT, "viewCustomer");
                }
            }

            messages.add("An error occured.");
            request.setAttribute("address", address);
        }

        // (request.getMethod().equals("GET")) 
        return new ActionResponse(ActionResponseType.FORWARD, "addAddress");
    }
}

package amu.action;

import amu.database.CustomerDAO;
import amu.model.Customer;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import javax.servlet.http.HttpSession;

class ActivateCustomerAction implements Action {

    @Override
    public ActionResponse execute(HttpServletRequest request, HttpServletResponse response) throws Exception {

        // If email field is set, but token is not provided then this is a idempotent request
        if (request.getParameter("email") != null && request.getParameter("activationToken") == null) {
            request.setAttribute("email", request.getParameter("email"));
        }

        // If both fields are set, then this is a non-idempotent activation request
        if (request.getParameter("email") != null && request.getParameter("activationToken") != null) {
            CustomerDAO customerDAO = new CustomerDAO();
            Customer customer = customerDAO.findByEmail(request.getParameter("email"));

            if (customer != null && customer.getActivationToken().equals(request.getParameter("activationToken"))) {
                customer = customerDAO.activate(customer);
                return new ActionResponse(ActionResponseType.REDIRECT, "activationSuccessful");
            } else {
                HttpSession session = request.getSession(true);
                session.setAttribute("debugActivation", customer);
                return new ActionResponse(ActionResponseType.REDIRECT, "activationError");
            }
        }

        return new ActionResponse(ActionResponseType.FORWARD, "activateCustomer");
    }
}

package amu.action;

public enum ActionResponseType {
    FORWARD, REDIRECT;
}

package amu.action;

import java.io.UnsupportedEncodingException;
import java.net.URLEncoder;
import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;
import java.util.Map.Entry;
import java.util.logging.Level;
import java.util.logging.Logger;

public class ActionResponse {

    private final ActionResponseType type;
    private final String url;
    private Map<String, String> parameters;

    public ActionResponse(ActionResponseType type, String url) {
        this.type = type;

        if (this.type == ActionResponseType.FORWARD) {
            this.url = "/" + url + ".jsp";
        } else { // (this.type == ActionResponseType.REDIRECT)
            this.url = url + ".do";
        }

        this.parameters = null;
    }

    public ActionResponseType getType() {
        return type;
    }

    public String getURL() {
        return url;
    }

    public void addParameter(String name, String value) {
        if (parameters == null) {
            parameters = new HashMap<String, String>();
        }

        parameters.put(name, value);
    }

    public String getParameterString() {

        if (parameters == null) {
            return "";
        } else {
            StringBuilder sb = new StringBuilder("?");

            Iterator<Entry<String, String>> it = parameters.entrySet().iterator();
            while (it.hasNext()) {
                Entry<String, String> parameter = it.next();

                try {
                    sb.append(URLEncoder.encode(parameter.getKey(), "UTF-8"));
                    sb.append("=");
                    sb.append(URLEncoder.encode(parameter.getValue(), "UTF-8"));
                } catch (UnsupportedEncodingException ex) {
                    Logger.getLogger(ActionResponse.class.getName()).log(Level.SEVERE, null, ex);
                }

                if (it.hasNext()) {
                    sb.append("&");
                }
            }
            return sb.toString();
        }
    }
}

package amu.action;

import java.util.Collections;
import java.util.HashMap;
import java.util.Map;
import javax.servlet.ServletContextEvent;
import javax.servlet.ServletContextListener;
import javax.servlet.http.HttpServletRequest;

public class ActionFactory implements ServletContextListener {

    private static final Map<String, Action> actions = fillActionMap();

    private static Map<String, Action> fillActionMap() {
        Map<String, Action> map = new HashMap<String, Action>();

        // Address actions
        map.put("addAddress", new AddAddressAction());
        map.put("editAddress", new EditAddressAction());
        map.put("deleteAddress", new DeleteAddressAction());

        // Book actions
        map.put("bookNotFound", new ForwardAction("bookNotFound"));
        map.put("viewBook", new ViewBookAction());

        // Cart actions
        map.put("addBookToCart", new AddToCartAction());
        map.put("updateCart", new UpdateCartAction());
        map.put("viewCart", new ViewCartAction());

        // Checkout process
        map.put("selectShippingAddress", new SelectShippingAddressAction());
        map.put("selectPaymentOption", new SelectPaymentOptionAction());
        map.put("reviewOrder", new ReviewOrderAction());
        map.put("placeOrder", new PlaceOrderAction());
        map.put("placeOrderError", new ForwardAction("placeOrderError"));
        map.put("placeOrderSuccessful", new ForwardAction("placeOrderSuccessful"));

        // Credit card actions
        map.put("addCreditCard", new AddCreditCardAction());
        map.put("deleteCreditCard", new DeleteCreditCardAction());

        // Customer actions
        map.put("loginCustomer", new LoginCustomerAction());
        map.put("loginError", new ForwardAction("loginError"));
        map.put("registerCustomer", new RegisterCustomerAction());
        map.put("registrationError", new ForwardAction("registrationError"));        
        map.put("activateCustomer", new ActivateCustomerAction());
        map.put("activationError", new ForwardAction("activationError"));
        map.put("activationSuccessful", new ForwardAction("activationSuccessful"));
        map.put("viewCustomer", new ViewCustomerAction());
        map.put("changePassword", new ChangePasswordAction());
        map.put("changeEmail", new ChangeEmailAction());
        map.put("changeName", new ChangeNameAction());

        // Customer support
        map.put("customerSupport", new CustomerSupportAction());
        map.put("customerSupportSuccessful", new ForwardAction("customerSupportSuccessful"));

        return Collections.unmodifiableMap(map);
    }

    public static Action getAction(HttpServletRequest request) {
        // Strip leading '/' and trailing '.do'
        String key = request.getServletPath().substring(1,request.getServletPath().length()-3);
        return actions.get(key);
    }

    public static boolean hasKey(String key) {
        return actions.containsKey(key);
    }

    @Override
    public void contextInitialized(ServletContextEvent sce) {
        // This function is run by the web application container during startup
        // due to config in web.xml. While this function does nothing in itself,
        // the static initializer (fillActionMap) is executed immediately before this,
        // and that's what we want to happen here.
    }

    @Override
    public void contextDestroyed(ServletContextEvent sce) {
        // Empty
    }
}

